using System;
using System.Net.Http;
using System.Security;
using System.Security.Cryptography;
using System.Security.Cryptography.X509Certificates;
using System.Text;
using System.Threading.Tasks;
using RestPkiCoreSignature.Classes;
using Newtonsoft.Json;

class Program
{
    private static readonly string Pdf = "";
    private static readonly string Certificate = "C:\\Users\\Daniel\\source\\repos\\RestPkiCoreSignature\\RestPkiCoreSignature\\Alan Mathison Turing (560.723.861-05).pfx";
    private static readonly string BaseUrl = "https://homolog.core.pki.rest/";
    private static readonly string ApiKey = "dev-support|82a5caeae3dc224ebe11bfd01a26e020bf3cc34cb46df1773b1d29580c892867";

    static async Task Main(string[] args)
    {

        var certificate = new X509Certificate2(Certificate, "1234");

        var certRaw = certificate.RawData;

        var response1 = await PostToRestPKI("/api/signature", new
        {
            file = new
            {
                mimeType = "application/pdf",
                content = Pdf
            },
            certificate = new
            {
                content = certRaw
            },
            securityContextId = "0193df45-cb4f-426e-9eb3-1ae2119f1174"
        });

        var response = JsonConvert.DeserializeObject<StartResponse>(response1);

        var privateKey = certificate.GetRSAPrivateKey();

        byte[] ToSignBytes = Convert.FromBase64String(response.ToSignHash.Value);

        var signature = privateKey.SignHash(ToSignBytes, HashAlgorithmName.SHA256, RSASignaturePadding.Pkcs1);

        var response2 = await PostToRestPKI("/api/signature/completion", new
        {
            state = response.State,
            signature = signature
        });

        var finish = JsonConvert.DeserializeObject<CompletionResponse>(response2);

           
           Console.WriteLine(finish.SignedFile.url);
           Console.ReadKey();

    }

    private static async Task<string> PostToRestPKI(string relativeUrl, object payload)
    {
         
        string fullUrl = $"{BaseUrl}{relativeUrl}";

        
        HttpClient client = new HttpClient();

        
        client.DefaultRequestHeaders.Add("x-api-key", ApiKey);

        
        string jsonPayload = JsonConvert.SerializeObject(payload);

       
        var content = new StringContent(jsonPayload, Encoding.UTF8, "application/json");

        try
        {
           
            HttpResponseMessage response = await client.PostAsync(fullUrl, content);

        
            return await response.Content.ReadAsStringAsync();
        }
        catch (Exception ex)
        {
            Console.WriteLine($"Erro ao enviar requisição para {fullUrl}: {ex.Message}");
            return null;
        }
    }
}
